import React from 'react';

function PairingDashboard({ pairedStudents, addToHistory }) {
  return (
    <div>
      <h2>Pairing Dashboard</h2>

      {pairedStudents.length > 0 ? (
        pairedStudents.map((pair, index) => (
          <div key={index} className="pair">
            <p>{pair.student1} and {pair.student2}</p>
            <button onClick={() => addToHistory(pair)}>Add to History</button>
          </div>
        ))
      ) : (
        <p>No pairs available.</p>
      )}
    </div>
  );
}

export default PairingDashboard;
